import React from "react";
import "./PersonCard.scss";

const PersonCard = props => {
  return (
    <div className="container">
      <div className="left-side">
        <img className="logo" alt="logo.jpg" src={props.logo} />
        <div className="bio">{props.bio}</div>
        <div className="twitter-handles">
          <a href="https://twitter.com/BarrenSkills">@BarrenSkills</a>
          <a href="https://twitter.com/barrenschools">@barrenschools</a>
          <a href="https://twitter.com/BarrenZone">@BarrenZone</a>
          <a href="https://twitter.com/Interapt">@Interapt</a>
        </div>
      </div>
      <div className="right-side">
        <img className="bio-pic" alt="bio-pic.jpg" src={props.pic} />
        <div className="name-age">
          {props.firstname}
          <span> {props.lastname}, </span>
          {props.age}
        </div>
        <div className="location">
          {props.county},<span className="state">{props.statename}</span>
        </div>
        <div className="time">{props.time}</div>
      </div>
    </div>
  );
};

export default PersonCard;
